import base64
class MockEnvState:
    """테스트를 위해 EnvState를 모방하는 클래스"""
    def __init__(self, url: str, screenshot_base64: str, message: str = "Action completed."):
        self.url = url
        # Base64 데이터를 raw 데이터로 디코딩
        self.screenshot = base64.b64decode(screenshot_base64)
        self.message = message
        # EnvState에 포함되는 다른 필드 (예: dom_tree 등)도 필요에 따라 추가

